/**
 * This include file defines color schemes for use in maps. It is loaded by library.php
 * and is in a separate file solely for readability, due to the length of this content.
 *
 * The content here is an assocarray, listing available color schemes.
 * Structure is: $COLORSCHEMES[class][name][numcolors] = assocarray(name,colors-list)
 *
 * There are 3 classes of color scheme: sequential, qualitative, diverging, unique
 * Qualitative uses a color scheme where the colors are intended to be different and visually distinct.
 * Sequential uses a color gradient (eg white, pink, dark pink, red, dark red) and is best suited for numeric data.
 * Diverging uses a color gradient, with white in the middle of the range and different colors on either side, e.g. red, pink, white, pale blue, dark blue
 * Unique is exactly the same as Qualitative, but with larger custom-made color lists to help ensure that colors repeat less often.
 *
 * @package Overview
 */


